INSERT INTO `item` (`id`, `type`, `skill`, `gender`, `name`, `subName`, `description`, `level`, `iconID`, `part`, `isUpToUp`, `isDrop`, `require`, `isExpires`, `secondsExpires`, `saleCoinLock`, `options`) VALUES (215, 13, 0, 3, 'Bùa Da Trâu', '', 'Tăng sức chịu đòn cho bạn. Khi bị quái đánh, máu sẽ mất ít hơn, chỉ còn 50% bình thường. Có tác dụng trong 1 khoảng thời gian kể từ lúc mua', 0, 1405, -1, 'True', 0, 0, 0, 0, 0, '[]');
